import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { TransactionProvider } from "./context/TransactionContext";

import HomeScreen from "./screens/HomeScreen";
import MoneyDiaryScreen from "./screens/MoneyDiaryScreen";
import AddTransactionScreen from "./screens/AddTransactionScreen";
import ViewTransactionsScreen from "./screens/ViewTransactionsScreen";

const Tab = createBottomTabNavigator();
const Stack = createNativeStackNavigator();

function MoneyDiaryStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="MoneyDiaryMain"
        component={MoneyDiaryScreen}
        options={{ title: "Money Diary" }}
      />
      <Stack.Screen
        name="AddTransaction"
        component={AddTransactionScreen}
        options={{ title: "Add Transaction" }}
      />
      <Stack.Screen
        name="ViewTransactions"
        component={ViewTransactionsScreen}
        options={{ title: "All Transactions" }}
      />
    </Stack.Navigator>
  );
}

export default function App() {
  return (
    <TransactionProvider>
      <NavigationContainer>
        <Tab.Navigator>
          <Tab.Screen name="Home" component={HomeScreen} />
          <Tab.Screen name="Money Diary" component={MoneyDiaryStack} />
        </Tab.Navigator>
      </NavigationContainer>
    </TransactionProvider>
  );
}
